import React, { memo } from "react";
import PropTypes from "prop-types";

import { HeaderWrapper } from "./style";

const LJThemeHeaderSmall = memo(function (props) {
  const { title, moreInfo } = props;

  return (
    <HeaderWrapper>
      <h3>{title}</h3>
      <a href="/todo">{moreInfo}</a>
    </HeaderWrapper>
  );
});

LJThemeHeaderSmall.defaultProps = {};

LJThemeHeaderSmall.propTypes = {
  title: PropTypes.string.isRequired,
  more: PropTypes.string,
};

export default LJThemeHeaderSmall;
